import "./Curriculums_visualization.css"

import {ourCurriculumEmpty, disciplinesOurCurriculumEmpty} from "../common/common_values";
import Curriculums_review from "../Curriculums_review/Curriculums_review";
import GeneralInformationAboutCurriculum from "../common/GeneralInformationAboutCurriculum";
import { Disciplines_section, Estimates_section } from "../Curriculums_review/parts";

import Estimate_modal from "./parts/Estimates_modal";
import Element_modal from "./parts/Element_modal";

const Curriculums_visualization = (props) => {

    const {valuesGroupsSkills, id, curriculums, disciplines, skills, estimates} = props;


    const ourCurriculum = ourCurriculumEmpty(id, curriculums);
    const disciplinesOurCurriculum = disciplinesOurCurriculumEmpty(id, disciplines);

    let tableValuesGroupsSkills = valuesGroupsSkills.map(el => {
        const estimate = Math.ceil((el.estimate)*100)/100;

        return (
            <tr>
                <td>{el.name}</td>
                <td>{estimate}</td>
                <td>{el.fragment}</td>
                <td>Цвет</td>
            </tr>
        )
    })



    return (
        <div>
            <div>
                <GeneralInformationAboutCurriculum ourCurriculum={ourCurriculum} />
                <Disciplines_section disciplinesOurCurriculum={disciplinesOurCurriculum} />
                <Estimates_section disciplinesOurCurriculum={disciplinesOurCurriculum} 
                                 skills={skills} estimates={estimates} />


                <Estimate_modal disciplinesOurCurriculum={disciplinesOurCurriculum} 
                                 skills={skills} estimates={estimates}/>
            </div>

            <div>
                Отредактировать "улыбку"
            </div>
            <div>
                Показать нулевые элементы
            </div>

            <div>
                <table>
                    <thead>
                        <tr>
                            <th>Group skills</th>
                            <th>Estimate</th>
                            <th>Fragment</th>
                            <th>Color</th>
                        </tr>
                    </thead>
                    <tbody>
                        {tableValuesGroupsSkills}
                    </tbody>
                </table>
            </div>

            <div>
                Таблица редактирования
            </div>

        </div>
    )
}

export default Curriculums_visualization;
